// TraineeDetailsPage.js

import React from 'react';

const TraineeDetailsPage = ({ match }) => {
  const traineeName = match.params.name;

  return (
    <div>
      <h1>Trainee Details - {traineeName}</h1>
      <div className="trainee-info">
        <img src="/person-icon.png" alt="User icon" />
        <div>
          <p>Number of courses completed: </p>
          <p>Number of courses in progress: </p>
          <p>Number of courses started: </p>
          <p>Number of courses in overdue: </p>
        </div>
      </div>
    </div>
  );
};

export default TraineeDetailsPage;
